        "groundingSupports": [
          {
            "segment": {
              "endIndex": 138,
              "text": "Otters are carnivorous, semi-aquatic mammals belonging to the **Mustelidae** family, which also includes weasels, badgers, and wolverines."
            },
            "groundingChunkIndices": [
              0,
              1,
              2
            ]
          },
          {
            "segment": {
              "startIndex": 139,
              "endIndex": 228,
              "text": "There are **13 extant species** found on every continent except Antarctica and Australia."
            },
            "groundingChunkIndices": [
              3
            ]
          },
          {
            "segment": {
              "startIndex": 230,
              "endIndex": 253,
              "text": "### Key Characteristics"
            },
            "groundingChunkIndices": [
              4,
              3,
              5,
              6,
              0,
              7,
              2,
              1,
              8
            ]
          },
          {
            "segment": {
              "startIndex": 254,
              "endIndex": 378,
              "text": "*   **Physical Traits:** They have long, streamlined bodies, webbed feet, and powerful tails that make them expert swimmers."
            },
            "groundingChunkIndices": [
              3,
              0,
              7,
              6
            ]
          },
          {
            "segment": {
              "startIndex": 379,
              "endIndex": 485,
              "text": "*   **Insulation:** Instead of blubber, otters rely on incredibly dense, water-resistant fur to stay warm."
            },
            "groundingChunkIndices": [
              0,
              1,
              5
            ]
          },
          {
            "segment": {
              "startIndex": 486,
              "endIndex": 587,
              "text": "Sea otters have the thickest fur in the animal kingdom, with up to one million hairs per square inch."
            },
            "groundingChunkIndices": [
              1
            ]
          },
          {
            "segment": {
              "startIndex": 588,
              "endIndex": 719,
              "text": "*   **Behavior:** Known for being highly intelligent and playful, they are often seen sliding down mudbanks or playing with stones."
            },
            "groundingChunkIndices": [
              0
            ]
          },
          {
            "segment": {
              "startIndex": 720,
              "endIndex": 810,
              "text": "Some species, like sea otters, are famous for using tools (rocks) to crack open shellfish."
            },
            "groundingChunkIndices": [
              5,
              7
            ]
          },
          {
            "segment": {
              "startIndex": 812,
              "endIndex": 830,
              "text": "### Habitat & Diet"
            },
            "groundingChunkIndices": [
              8,
              7,
              0,
              2,
              3,
              5,
              4
            ]
          },
          {
            "segment": {
              "startIndex": 831,
              "endIndex": 984,
              "text": "*   **Environments:** Most species live in freshwater (rivers, lakes, and wetlands), while the sea otter and marine otter live in saltwater environments."
            },
            "groundingChunkIndices": [
              3,
              5,
              4
            ]
          },
          {
            "segment": {
              "startIndex": 986,
              "endIndex": 1158,
              "text": "*   **Social Life:** Social structures vary; river otters are often solitary or live in small family groups, whereas sea otters can gather in large groups called **rafts**."
            },
            "groundingChunkIndices": [
              7
            ]
          },
          {
            "segment": {
              "startIndex": 1159,
              "endIndex": 1292,
              "text": "*   **Diet:** They are opportunistic hunters that primarily eat fish, crustaceans, mollusks, and occasionally small mammals or birds."
            },
            "groundingChunkIndices": [
              0
            ]
          },
          {
            "segment": {
              "startIndex": 1294,
              "endIndex": 1311,
              "text": "### Major Species"
            },
            "groundingChunkIndices": [
              5,
              3,
              0,
              4,
              8
            ]
          },
          {
            "segment": {
              "startIndex": 1312,
              "endIndex": 1398,
              "text": "*   **Sea Otter:** The heaviest otter, living almost exclusively in the Pacific Ocean."
            },
            "groundingChunkIndices": [
              5
            ]
          },
          {
            "segment": {
              "startIndex": 1586,
              "endIndex": 1694,
              "text": "*   **North American River Otter:** A common freshwater species found throughout much of Canada and the U.S."
            },
            "groundingChunkIndices": [
              5,
              8
            ]
          }
        ],
